    max-width: 80%;
    margin: auto;
    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: center;
}

.title {
    display: flex;
    justify-content: center; /* Center items horizontally */
    align-items: flex-start; /* Align items to the top */
    font-size: 2em;
    transition: background-color 0.5s;
    padding-top: 20px; /* Add some padding to avoid text sticking to the top */
}

.intro-bold {
    font-weight: bold;
    font-size: 85px;
    text-shadow: 4px 4px 5px pink;
}

.text-block {
    margin: 10px;
    position: relative;
    display: flex;
    align-items: center;
    padding: 20px;
}

.text-left {
    flex: 0 0 30%;
    justify-content: flex-end;
    text-align: right;
}

.text-right {
    flex: 0 0 70%;
    justify-content: flex-start;
    text-align: left;
    margin-top: -60px;
}

.skills {
    display: flex;
    justify-content: center;
}

.skills__row {
    display: flex;
    flex-direction: column;
    justify-content: center;
}

.skills__item {
    border-color: transparent;
    background-image: linear-gradient(rgb(20, 21, 22), rgb(20, 21, 22)), radial-gradient(circle at left top, rgb(19, 89, 150), rgb(158, 0, 12));
}

.skills__item-fade-in {
    opacity: 1;
}

