    background-origin: border-box;
    background-clip: content-box, border-box;
    transition: transform 0.2s, opacity 1.2s;
    overflow: hidden;
}

/* Media Query for Small Screens */
@media (max-width: 600px) {
    #main {
        flex-direction: column;
        align-items: center;
        justify-content: center;
    }

